    return (
        <section className='promo'>
            <h1 className="promo__title">
                ECO <br/>
            </h1>
            <h2 className="promo__subtitle">
            это один простой баланс, который позволяет вам тратить, отправлять, сохранять и зарабатывать деньги.

            </h2>
        </section>
    )
}
